package hello;

public class IncrementDecrement {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int car=5;
		
		
		System.out.println(car++);
		System.out.println(car);
		
		System.out.println(++car);
		System.out.println(car);
		
		System.out.println(car--);
		System.out.println(car);
		
		System.out.println(--car);
		System.out.println(car);
		
		
	}

}
